export default {
  data: function data() {
    return {
      biaogeshuju: {},
      show: false,
      show1: false,
      show2: false,
      dialogVisible: false,
      showshow: false
    };
  },
  created: function created() {
    var _this = this;

    if (this.$route.params.state == "已过期") {
      this.showshow = true;
    }

    if (this.$route.params.state == '已接访') {
      this.show2 = true;
      this.show = true;
    }

    if (this.$route.params.state == '待接访') {
      this.show1 = true;
    }

    this.$api.getchuangkoubiaoge(this.$route.params.id).then(function (res) {
      console.log(res);

      if (res.code === 0) {
        _this.biaogeshuju = res.data;
      } else {
        _this.$message.error('获取表格数据失败');
      }
    });
  },
  mounted: function mounted() {},
  methods: {
    beginJf: function beginJf() {
      this.dialogVisible = true;
    },
    jiefang: function jiefang() {
      var _this2 = this;

      this.$api.getchuangkouchange(this.$route.params.id).then(function (res) {
        if (res.code === 0) {
          _this2.show = true;
          _this2.show1 = false;
          _this2.show2 = true;
          _this2.dialogVisible = false;

          _this2.$message.success('接访成功');
        } else {
          _this2.$message.error('接访失败');
        }
      }).catch(function (err) {
        console.log(err);
      });
    }
  }
};
